
$(document).ready(function () {
    $('#cpf, #cpfRetirada').inputmask("999.999.999-99");

    $('#telefone').inputmask('(99) 9999[9]-9999');

    $("body").tooltip({selector: '[data-toggle=tooltip]'});
    $(".informacoes").hide();

    $(function () {
        $('#selEstado').on('change', function () {
            var num = this.value;
            var serviceBase = window.location.origin + '/ged/assets/js/app/api/v1';

            $.ajax({
                type: 'GET',
                url: serviceBase + '/cidades',
                data: {estado: num, respostaAjax: true},
                dataType: 'json',
                beforeSend: function () {
                    $('#load').show();
                },
                success: function (data) {
                    $('#load').hide();

                    if (data) {
                        $('#selCidade').empty();
                        for (var prop in data) {
                            $('#selCidade').append(
                                    $('<option></option>').val(data[prop].id).html(data[prop].nome));
                        }
                    }
                },
                error: function (data) {
                    $('#load').hide();
                }
            });

        });

    });

    $(function () {
        $('#cpfRetirada').on('blur', function () {
            var num = limpa(this.value);
            var serviceBase = window.location.origin + '/ged/assets/js/app/api/v1';

            $.ajax({
                type: 'GET',
                url: serviceBase + '/usuariocpf',
                data: {cpf: num, respostaAjax: true},
                dataType: 'json',
                beforeSend: function () {
                    $('#load').show();
                },
                success: function (data) {
                    $('#load').hide();

                    if (data && data != "") {
                        $('.erros').hide();

                        for (var prop in data) {
                            $('.informacoes').show().html("<h3><strong>Dados do Usuário</strong></h3>\n\
                                                    <strong>Nome: </strong>" + data[prop].nome + "<br>\n\
                                                    <strong>Cidade/Estado: \n\
                                                    </strong>  " + data[prop].nomeCidade + " - " + data[prop].sigla);

                            $('#identUsuario').attr('value', data[prop].id);
                            $(':submit').removeAttr('disabled');


                        }
                    } else {
                        $('.informacoes').hide();

                        $('.erros').show().html("<div class='alert alert-danger' role='alert'>\n\
                                <span class='glyphicon glyphicon-exclamation-sign' aria-hidden='true'></span>\n\
                                <span class='sr-only'>Error:</span>\n\
                                Usuário não cadastrado\n\
                            </div>");
                        $(':submit').attr('disabled', 'disabled');
                        $('#identUsuario').attr('value', "");

                    }
                },
                error: function (data) {
                    $('#load').hide();
                }
            });

        });

    });





      $(function () {
        $('#quantidadeR').on('blur', function () {
            var num = $('#selProduto').val();
            var qtd = $('#quantidadeR').val();
            var serviceBase = window.location.origin + '/ged/assets/js/app/api/v1';

            $.ajax({
                type: 'GET',
                url: serviceBase + '/quantidade',
                data: {id: num},
                dataType: 'json',
                beforeSend: function () {
                    $('#load').show();
                },
                success: function (data) {
                    $('#load').hide();

                    if (data && data != "") {
                         for (var prop in data) {
                             
                             
                             if(parseInt(qtd) > parseInt(data[prop].qtde)){
                                 
                                 $('#alertaQuantidade').show().html("<span  class='messages'>Há " + data[prop].qtde      + " item(ns) em estoque</span>");
                             }else{
                                 
                                 $('#alertaQuantidade').hide();
                             }


                        }
                    }  
                },
                error: function (data) {
                    $('#load').hide();
                }
            });

        });

    });

    var imgData = 'data:image/png;base64,';
    var doc = new jsPDF();
    var specialElementHandlers = {
        '#editor': function (element, renderer) {
            return true;
        }
    };
    doc.addImage(imgData, 'JPEG', 10, 10, 30, 30);
    doc.text(40, 20, 'GED - Gestão de Estoque e Distribuição');
    doc.text(80,35, 'Comprovante');
  
    $('#btGerarPDF').click(function () {
        doc.fromHTML($('#dadosImpressao').html(), 40, 40, {
            'width': 200,
            'elementHandlers': specialElementHandlers
        });
        doc.output('dataurlnewwindow');   
    });

});

 